import React from "react";
import ConCard from "./Con-Card";
import image from "./mask-group-nuo.png"

function Cards(){
    return(
    <ConCard 
        obj={{
            img:`${image}`,
            name:"ayman"
        }}
    />
    
    )
}

export default Cards
